-- Some action helpers.
action f _ _ = return f

identifierAction (_, _, _, s) len = return $ IdToken (take len s)

intLiteralAction (_, _, _, s) len = return $ IntToken (read (take len s) :: Int)

lexerError msg = Alex $ \s -> Left msg

