-- Lexing helpers.
getTokens = do
  tok <- alexMonadScan
  if tok == EofToken
  then return [tok]
  else do toks <- getTokens
          return $ tok : toks

runLexer str = runAlex str getTokens

lexer cont = do
  token <- alexMonadScan
  cont token

-- Type synonym for Alex monad that must be exported
-- for Happy parser to work.
type P a = Alex a

main = do
    s <- getContents
    let tokens = case runLexer s of
                    Left msg -> msg
                    Right ts -> intercalate "\n" $ map show ts
    print tokens


